script: |
  super -f text -I q7930.spq | sort > q7930.out

inputs:
  - name: q7930.spq
    data: |
      SELECT DISTINCT - + col2 * + col0 * col2, - ( - 13 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q7930.out
    data: |
      -33135	13
      -8700	13
      -950697	13
